function: "This dock design is a collaboration between Cid Vilas and Myself.  Cid has a NexusOne and I do not... I have access to Pro/Engineer but Cid does not.  Collaboration was done over the internets to design the dock then Cid downloaded the design and printed it to test.\r\n\r\nThe google groups discussion that started this...\r\nhttp://groups.google.com/group/makerbot/browse_thread/thread/4eba69b063ad2655/da9e3fd64f6f36b0?\r\n\r\nCid's Flickr showing the V.1 dock printed...\r\nhttp://www.flickr.com/photos/cidvilas/sets/72157623147557961/\r\n\r\nThis is the second version of the NexusOne dock, the first version did not have the pockets for the BBs and the phone sat further forward on the dock.\r\n\r\nBesides the requisite STL file I have also included the parametric Pro/Engineer CAD file as well a STEP and IGES file for those with different CAD packages."
